// client/src/App.js

import "./App.css";
import React from "react";
import Home from "./Home";
import { Routes ,Route } from 'react-router-dom';
import ReactDOM from 'react-dom';



function App() {

  return (
    <Router>

      <Routes>
        <div className="App-body">
          <Route path='/welcome' element={<Home/>} />
        </div>

      </Routes>
    </Router>

  );
}

export default App;
